  true,\n\t\"url\": null,\n\t\"notes\": \"<p>For more than 20 years, the Dartmouth
  Atlas Project has documented glaring variations in how medical resources are distributed
  and used in the United States. The project uses Medicare data to provide information
  and analysis about national, regional, and local markets, as well as hospitals and
  their affiliated physicians. This research has helped policymakers, the media, health
  care analysts and others improve their understanding of our health care system and
  forms the foundation for many of the ongoing efforts to improve health and health
  systems across America.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
